INSERT INTO `wp_posts` VALUES (15,1,'2022-04-07 13:01:55','2022-04-07 17:01:55','<!-- wp:genesis-blocks/gb-spacer {\"spacerHeight\":58} -->\n<div style=\"color:#ddd\" class=\"wp-block-genesis-blocks-gb-spacer gb-block-spacer gb-divider-solid gb-divider-size-1\"><hr style=\"height:58px\"/></div>\n<!-- /wp:genesis-blocks/gb-spacer -->\n\n<!-- wp:heading {\"style\":{\"typography\":{\"fontSize\":\"48px\"}}} -->\n<h2 style=\"font-size:48px\">This is what A &amp; R is About</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Auto Repair Shop in Fairmont Open today until 6:30 PM</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:shortcode -->\n<figure class=\"wpTable\"><table><tbody><tr><th>Mon:</th><td>8:00 AM – 6:30 PM</td></tr><tr><th>Tue:</th><td>8:00 AM – 6:30 PM</td></tr><tr><th>Wed:</th><td>8:00 AM – 6:30 PM</td></tr><tr><th>Thu:</th><td>8:00 AM – 6:30 PM</td></tr><tr><th>Fri:</th><td>8:00 AM – 6:30 PM</td></tr><tr><th>Sat:</th><td>8:00 AM – 6:30 PM</td></tr><tr><th>Sun:</th><td>Closed</td></tr></tbody></table></figure>\n<!-- /wp:shortcode -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Business Hours</h3>\n<!-- /wp:heading -->\n\n<!-- wp:gravityforms/form {\"formId\":\"1\",\"formPreview\":false} /-->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Contact</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"is-style-default\"} -->\n<p class=\"is-style-default\"></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>(910) 856-1156</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>(910) 538-5772</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Address</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>6967 NC Hwy 904Fairmont, North Carolina 28340United States</p>\n<!-- /wp:paragraph -->','About','','publish','closed','closed','','about','','','2022-05-03 11:12:19','2022-05-03 15:12:19','',0,'http://ar-auto-repair-services.local/?page_id=15',0,'page','',0);
