INSERT INTO `wp_posts` VALUES (17,1,'2022-04-07 13:02:08','2022-04-07 17:02:08','<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:shortcode -->\n<>\n<div class=\"wpBG test-group\">\n<h3>Brake Warning Light</h3>\n<p>Either the parking brake is engaged or there’s a problem with your braking system</p>\n<h3>Tire Pressure Light</h3>\n<p>Signals an issue with your tire pressure or the Tire Pressure Monitoring System (TPMS)</p>\n<h3>Battery Alert Light</h3>\n<p>Signifies a problem with the vehicle’s charging system.</p>\n<h3>Oil Pressure Light </h3>\n<p>Indicates that there is an issue with your car’s oil pressure system</p>\n<h3>Engine Temp Warning Light</h3>\n<p>It means that your engine is overheating.</p>\n<h3>Check Engine Light</h3>\n<p>May appear for a variety of reasons. Sometimes it is triggered by an open, loose or cracked gas cap, which causes fuel to evaporate. But sometimes it indicates a serious issue, like low oil pressure or overheating!</p>\n</div>\n</>\n<!-- /wp:shortcode -->\n\n<!-- wp:genesis-blocks/gb-columns {\"columns\":1,\"layout\":\"one-column\",\"align\":\"full\",\"paddingTop\":15,\"paddingRight\":5,\"paddingBottom\":15,\"paddingLeft\":5,\"paddingUnit\":\"%\",\"columnMaxWidth\":1200,\"className\":\"gpb-agency-section-icon-mini-card\"} -->\n<div class=\"wp-block-genesis-blocks-gb-columns gpb-agency-section-icon-mini-card gb-layout-columns-1 one-column gb-columns-center alignfull\" style=\"padding-top:15%;padding-right:5%;padding-bottom:15%;padding-left:5%\"><div class=\"gb-layout-column-wrap gb-block-layout-column-gap-2 gb-is-responsive-column\" style=\"max-width:1200px\"><!-- wp:genesis-blocks/gb-column -->\n<div class=\"wp-block-genesis-blocks-gb-column gb-block-layout-column\"><div class=\"gb-block-layout-column-inner\"><!-- wp:genesis-blocks/gb-container {\"containerMarginBottom\":5,\"containerMaxWidth\":700} -->\n<div style=\"margin-bottom:5%\" class=\"wp-block-genesis-blocks-gb-container gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\" style=\"max-width:700px\"></div></div></div>\n<!-- /wp:genesis-blocks/gb-container --></div></div>\n<!-- /wp:genesis-blocks/gb-column --></div></div>\n<!-- /wp:genesis-blocks/gb-columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','Services','','publish','closed','closed','','services','','','2022-05-03 10:58:56','2022-05-03 14:58:56','',0,'http://ar-auto-repair-services.local/?page_id=17',0,'page','',0);
