INSERT INTO `wp_posts` VALUES (32,1,'2022-04-07 16:48:49','2022-04-07 20:48:49','<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:genesis-blocks/gb-testimonial {\"testimonialImgID\":null} -->\n<div style=\"background-color:#f2f2f2;color:#32373c\" class=\"wp-block-genesis-blocks-gb-testimonial left-aligned gb-font-size-18 gb-block-testimonial\"><div class=\"gb-testimonial-text\"><p>My truck broke down while driving to an emergency appointment for my dog several hours away. By the time I got towed here, it was almost closing time. They were so nice, and helped me out tremendously by staying late to fix my truck, then getting me on my way again.</p></div><div class=\"gb-testimonial-info\"><h2 class=\"gb-testimonial-name\" style=\"color:#32373c\">-JG</h2><small class=\"gb-testimonial-title\" style=\"color:#32373c\">⭐⭐⭐⭐⭐ </small></div></div>\n<!-- /wp:genesis-blocks/gb-testimonial -->\n\n<!-- wp:genesis-blocks/gb-testimonial -->\n<div style=\"background-color:#f2f2f2;color:#32373c\" class=\"wp-block-genesis-blocks-gb-testimonial left-aligned gb-font-size-18 gb-block-testimonial\"><div class=\"gb-testimonial-text\"><p>Good service and ryan is a good mechanic they were nice and chill with everything and on time and they got my truck back on the road 10/10 service</p></div><div class=\"gb-testimonial-info\"><h2 class=\"gb-testimonial-name\" style=\"color:#32373c\">Brizzy B</h2><small class=\"gb-testimonial-title\" style=\"color:#32373c\">⭐⭐⭐⭐⭐ </small></div></div>\n<!-- /wp:genesis-blocks/gb-testimonial --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:genesis-blocks/gb-testimonial -->\n<div style=\"background-color:#f2f2f2;color:#32373c\" class=\"wp-block-genesis-blocks-gb-testimonial left-aligned gb-font-size-18 gb-block-testimonial\"><div class=\"gb-testimonial-text\"><p>Best mechanic ever! Been here 3 times referred by my sister. I had 3 different needs and mechani