INSERT INTO `wp_posts` VALUES (89,1,'2022-04-13 10:23:17','2022-04-13 14:23:17','<!-- wp:cgb/icon-card-grid -->\n<div class=\"wp-block-cgb-icon-card-grid icon-card-grid columns-3\"><!-- wp:cgb/clb-icon-card {\"iconSize\":\"6x\",\"iconStyle\":\"fas\"} -->\n<div class=\"wp-block-cgb-clb-icon-card clb-icon-card-area foreground-text-light\" style=\"background-color:#555d66\"><a class=\"clb-icon-card-link\"><div class=\"clb-card-icon\"><i class=\"fas fa-info-circle fa-6x\"></i></div><h3 class=\"clb_card__title\">Oil Pressure Warning Light</h3></a></div>\n<!-- /wp:cgb/clb-icon-card -->\n\n<!-- wp:cgb/clb-icon-reveal-card -->\n<div class=\"clb-icon-reveal-card clb-icon-card-area undefined\" style=\"--clb-accent-color:#555d66\"><a href=\"#undefined\" class=\"clb-icon-card-link\"><div class=\"clb-card-icon\"><i class=\"far fa-info-circle fa-3x\"></i></div><h3 class=\"clb_card__title\"></h3></a></div><div class=\"undefined clb-icon-reveal-card-contents clb-hide\" style=\"--clb-accent-color:#555d66\"><!-- wp:paragraph -->\n<p><strong>What It Means: </strong>This <a href=\"https://vatire.com/car-maintenance-tips/why-is-my-dashboard-oil-light-on/\">old-fashioned oil can symbol</a> indicates that there is an issue with your car’s oil pressure system. Either you’re running <a href=\"https://vatire.com/services/oil-change/\">low on oil</a> or your oil pump isn’t circulating enough fluid to properly lubricate the surfaces inside your engine. (NOTE: Some car dashboards will display the word “OIL” instead of this symbol.)</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:cgb/clb-icon-reveal-card --></div>\n<!-- /wp:cgb/icon-card-grid -->','Services','','inherit','closed','closed','','17-revision-v1','','','2022-04-13 10:23:17','2022-04-13 14:23:17','',17,'http://ar-auto-repair-services.local/?p=89',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (91,1,'2022-04-13 10:25:44','2022-04-13 14:25:44','<!-- wp:cgb/icon-card-reveal-grid -->\n<div class=\"wp-block-cgb-icon-card-reveal-grid clb-icon-reveal-main-wrapper\"><div class=\"clb-icon-card-reveal-grid icon-card-grid columns-3\"><!-- wp:cgb/clb-icon-reveal-card {\"iconCardLink\":\"oil-pressure-light\"} -->\n<div class=\"clb-icon-reveal-card clb-icon-card-area oil-pressure-light\" style=\"--clb-accent-color:#555d66\"><a href=\"#oil-pressure-light\" class=\"clb-icon-card-link\"><div class=\"clb-card-icon\"><i class=\"far fa-info-circle fa-3x\"></i></div><h3 class=\"clb_card__title\">Oil Pressure Light</h3></a></div><div id=\"oil-pressure-light\" class=\"oil-pressure-light clb-icon-reveal-card-contents clb-hide\" style=\"--clb-accent-color:#555d66\"><!-- wp:paragraph -->\n<p><strong>What It Means: </strong>This old-fashioned oil can symbol indicates that there is an issue with your car’s oil pressure system. Either you’re running low on oil or your oil pump isn’t circulating enough fluid to properly lubricate the surfaces inside your engine. (NOTE: Some car dashboards will display the word “OIL” instead of this symbol.)</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:cgb/clb-icon-reveal-card --></div><div class=\"clb-reveal-contents-area\"></div></div>\n<!-- /wp:cgb/icon-card-reveal-grid -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','Services','','inherit','closed','closed','','17-revision-v1','','','2022-04-13 10:25:44','2022-04-13 14:25:44','',17,'http://ar-auto-repair-services.local/?p=91',0,'revision','',0);
