INSERT INTO `wp_posts` VALUES (132,1,'2022-04-27 14:22:56','2022-04-27 18:22:56','<!-- wp:genesis-blocks/gb-cta {\"buttonText\":\"Get Directions\"} -->\n<div style=\"text-align:center\" class=\"wp-block-genesis-blocks-gb-cta gb-block-cta\"><div class=\"gb-cta-content\"><h2 class=\"gb-cta-title gb-font-size-32\" style=\"color:#32373c\">Where Are We?</h2><div class=\"gb-cta-text gb-font-size-32\" style=\"color:#32373c\"></div></div><div class=\"gb-cta-button\"><a href=\"https://www.google.com/maps/dir//A%26R+Auto+Repair+and+Services/@34.3996609,-79.1946082,12z/data=!4m8!4m7!1m0!1m5!1m1!1s0x89aabfcfbc0a053f:0x1e9f3e1d3b49d8ea!2m2!1d-79.1245681!2d34.3996809\" target=\"_self\" rel=\"noopener noreferrer\" class=\"gb-button gb-button-shape-rounded gb-button-size-medium\" style=\"color:#ffffff;background-color:#3373dc\">Get Directions</a></div></div>\n<!-- /wp:genesis-blocks/gb-cta -->\n\n<!-- wp:heading {\"textAlign\":\"center\",\"level\":3} -->\n<h3 class=\"has-text-align-center\"><strong>What Customers Say About Us</strong></h3>\n<!-- /wp:heading -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:genesis-blocks/gb-testimonial -->\n<div style=\"background-color:#f2f2f2;color:#32373c\" class=\"wp-block-genesis-blocks-gb-testimonial left-aligned gb-font-size-18 gb-block-testimonial\"><div class=\"gb-testimonial-text\"><p>My truck broke down while driving to an emergency appointment for my dog several hours away. By the time I got towed here, it was almost closing time. They were so nice, and helped me out tremendously by staying late to fix my truck, then getting me on my way again.</p></div><div class=\"gb-testimonial-info\"><h2 class=\"gb-testimonial-name\" style=\"color:#32373c\">-JG</h2><small class=\"gb-testimonial-title\" style=\"color:#32373c\">⭐⭐⭐⭐⭐ </small></div></div>\n<!-- /wp:genesis-blocks/gb-testimonial --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- w