32373c\" class=\"wp-block-genesis-blocks-gb-testimonial left-aligned gb-font-size-18 gb-block-testimonial\"><div class=\"gb-testimonial-text\"><p>Good service and ryan is a good mechanic they were nice and chill with everything and on time and they got my truck back on the road 10/10 service</p></div><div class=\"gb-testimonial-info\"><h2 class=\"gb-testimonial-name\" style=\"color:#32373c\">Brizzy B</h2><small class=\"gb-testimonial-title\" style=\"color:#32373c\">⭐⭐⭐⭐⭐ </small></div></div>\n<!-- /wp:genesis-blocks/gb-testimonial --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:genesis-blocks/gb-columns {\"focalPoint\":{\"x\":\"0.50\",\"y\":\"0.50\"},\"columns\":1,\"layout\":\"gb-1-col-equal\",\"columnsGap\":3,\"align\":\"full\",\"paddingTop\":6,\"paddingRight\":1,\"paddingBottom\":6,\"paddingLeft\":1,\"paddingUnit\":\"em\",\"customTextColor\":\"#1f1f1f\",\"customBackgroundColor\":\"#f5f5f5\",\"columnMaxWidth\":1200,\"className\":\"gpb-infinity-section-map-location \"} -->\n<div class=\"wp-block-genesis-blocks-gb-columns gpb-infinity-section-map-location gb-layout-columns-1 gb-1-col-equal gb-has-custom-background-color gb-has-custom-text-color gb-columns-center alignfull\" style=\"padding-top:6em;padding-right:1em;padding-bottom:6em;padding-left:1em;background-color:#f5f5f5;color:#1f1f1f;background-position:50% 50%\"><div class=\"gb-layout-column-wrap gb-block-layout-column-gap-3 gb-is-responsive-column\" style=\"max-width:1200px\"><!-- wp:genesis-blocks/gb-column -->\n<div class=\"wp-block-genesis-blocks-gb-column gb-block-layout-column\"><div class=\"gb-block-layout-column-inner\"><!-- wp:heading {\"textAlign\":\"center\",\"style\":{\"typography\":{\"fontSize\":48,\"lineHeight\":\"1.2\"},\"color\":{\"text\":\"#1f1f1f\"}}} -->\n<h2 class=\"has-text-align-center has-text-color\" style=\"color:#1f1f1f;font-size:48px;line-height:1.2\">Where To Find Us</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-