\n<!-- wp:genesis-blocks/gb-column -->\n<div class=\"wp-block-genesis-blocks-gb-column gb-block-layout-column\"><div class=\"gb-block-layout-column-inner\"><!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:genesis-blocks/gb-column --></div></div>\n<!-- /wp:genesis-blocks/gb-columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:genesis-blocks/gb-column --></div></div>\n<!-- /wp:genesis-blocks/gb-columns -->\n\n<!-- wp:genesis-blocks/gb-cta {\"buttonText\":\"Get Directions\"} -->\n<div style=\"text-align:center\" class=\"wp-block-genesis-blocks-gb-cta gb-block-cta\"><div class=\"gb-cta-content\"><h2 class=\"gb-cta-title gb-font-size-32\" style=\"color:#32373c\">Where Are We?</h2><div class=\"gb-cta-text gb-font-size-32\" style=\"color:#32373c\"></div></div><div class=\"gb-cta-button\"><a href=\"https://www.google.com/maps/dir//A%26R+Auto+Repair+and+Services/@34.3996609,-79.1946082,12z/data=!4m8!4m7!1m0!1m5!1m1!1s0x89aabfcfbc0a053f:0x1e9f3e1d3b49d8ea!2m2!1d-79.1245681!2d34.3996809\" target=\"_self\" rel=\"noopener noreferrer\" class=\"gb-button gb-button-shape-rounded gb-button-size-medium\" style=\"color:#ffffff;background-color:#3373dc\">Get Directions</a></div></div>\n<!-- /wp:genesis-blocks/gb-cta -->\n\n<!-- wp:heading {\"textAlign\":\"center\",\"level\":3} -->\n<h3 class=\"has-text-align-center\"><strong>What Customers Say About Us</strong></h3>\n<!-- /wp:heading -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:genesis-blocks/gb-testimonial -->\n<div style=\"background-color:#f2f2f2;color:#32373c\" class=\"wp-block-genesis-blocks-gb-testimonial left-aligned gb-font-size-18 gb-block-testimonial\"><div class=\"gb-testimonial-text\"><p>My truck broke down while driving to an emergency appointment for my dog several hours away. By the time I got towed here, it was almost closing time. They were so nice, and helped me out tremendously by staying late to fix my truck, then getting me on my way again.</p></div><div class=\"gb-testimonial-info\"><h2 class=\"gb-testimonial-name\" style=\"color:#32373c\">-JG</h2><small class=\"gb-testimonial-title\" style=\"color:#32373c\">⭐⭐⭐⭐⭐ </small></div></div>\n<!-- /wp:genesis-blocks/gb-testimonial --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:genesis-blocks/gb-testimonial -->\n<div style=\"background-color:#f2f2f2;color:#32373c\" class=\"wp-block-genesis-blocks-gb-testimonial left-aligned gb-font-size-18 gb-block-testimonial\"><div class=\"gb-testimonial-text\"><p>Best mechanic ever! Been here 3 times referred by my sister. I had 3 different needs and mechanic Ryan solved the problems several other mechanics couldn\'t. He knows cars. He\'s the go-to-Guy.</p></div><div class=\"gb-testimonial-info\"><h2 class=\"gb-testimonial-name\" style=\"color:#32373c\"><strong>- Lateisha W</strong></h2><small class=\"gb-testimonial-title\" style=\"color:#32373c\">⭐⭐⭐⭐⭐ </small></div></div>\n<!-- /wp:genesis-blocks/gb-testimonial -->\n\n<!-- wp:genesis-blocks/gb-testimonial -->\n<div style=\"background-color:#f2f2f2;color:#32373c\" class=\"wp-block-genesis-blocks-gb-testimonial left-aligned gb-font-size-18 gb-block-testimonial\"><div class=\"gb-testimonial-text\"><p>Great place fast reliable service the best in Lumberton if u new to town you’ll want to come here</p></div><div class=\"gb-testimonial-info\"><h2 class=\"gb-testimonial-name\" style=\"color:#32373c\">Love MsJindahouse</h2><small class=\"gb-testimonial-title\" style=\"color:#32373c\">⭐⭐⭐⭐⭐ </small></div></div>\n<!-- /wp:genesis-blocks/gb-testimonial --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:genesis-blocks/gb-testimonial -->\n<div style=\"background-color:#f2f2f2;color:#32373c\" class=\"wp-block-genesis-blocks-gb-testimonial left-aligned gb-font-size-18 gb-block-testimonial\"><div class=\"gb-testimonial-text\"><p><q>Honest and reliable. Fast service &amp; easy to work with.</q></p></div><div class=\"gb-testimonial-info\"><h2 class=\"gb-testimonial-name\" style=\"color:#32373c\">-Jake</h2><small class=\"gb-testimonial-title\" style=\"color:#32373c\">⭐⭐⭐⭐⭐ </small></div></div>\n<!-- /wp:genesis-blocks/gb-testimonial -->\n\n<!-- wp:genesis-blocks/gb-testimonial -->\n<div style=\"background-color:#f2f2f2;color:#32373c\" class=\"wp-block-genesis-blocks-gb-testimonial left-aligned gb-font-size-18 gb-block-testimonial\"><div class=\"gb-testimonial-text\"><p>Good service and ryan is a good mechanic they were nice and chill with everything and on time and they got my truck back on the road 10/10 service</p></div><div class=\"gb-testimonial-info\"><h2 class=\"gb-testimonial-name\" style=\"color:#32373c\">Brizzy B</h2><small class=\"gb-testimonial-title\" style=\"color:#32373c\">⭐⭐⭐⭐⭐ </small></div></div>\n<!-- /wp:genesis-blocks/gb-testimonial --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:genesis-blocks/gb-columns {\"focalPoint\":{\"x\":\"0.50\",\"y\":\"0.50\"},\"columns\":1,\"layout\":\"gb-1-col-equal\",\"columnsGap\":3,\"align\":\"full\",\"paddingTop\":6,\"paddingRight\":1,\"paddingBottom\":6,\"paddingLeft\":1,\"paddingUnit\":\"em\",\"customTextColor\":\"#1f1f1f\",\"customBackgroundColor\":\"#f5f5f5\",\"columnMaxWidth\":1200,\"className\":\"gpb-infinity-section-map-location \"} -->\n<div class=\"wp-block-genesis-blocks-gb-columns gpb-infinity-section-map-location gb-layout-columns-1 gb-1-col-equal gb-has-custom-background-color gb-has-custom-text-color gb-columns-center alignfull\" style=\"padding-top:6em;padding-right:1em;padding-bottom:6em;padding-left:1em;background-color:#f5f5f5;color:#1f1f1f;background-position:50% 50%\"><div class=\"gb-layout-column-wrap gb-block-layout-column-gap-3 gb-is-responsive-column\" style=\"max-width:1200px\"><!-- wp:genesis-blocks/gb-column -->\n<div class=\"wp-block-genesis-blocks-gb-column gb-block-layout-column\"><div class=\"gb-