paddingRight\":6,\"paddingBottom\":4,\"paddingLeft\":6,\"paddingUnit\":\"%\",\"customBackgroundColor\":\"#efefef\"} -->\n<div class=\"wp-block-genesis-blocks-gb-columns gb-layout-columns-2 gb-2-col-wideright gb-has-custom-background-color aligncenter\" style=\"margin-bottom:5%;padding-top:6%;padding-right:6%;padding-bottom:4%;padding-left:6%;background-color:#efefef\"><div class=\"gb-layout-column-wrap gb-block-layout-column-gap-2 gb-is-responsive-column\"><!-- wp:genesis-blocks/gb-column {\"columnVerticalAlignment\":\"center\"} -->\n<div class=\"wp-block-genesis-blocks-gb-column gb-block-layout-column gb-is-vertically-aligned-center\"><div class=\"gb-block-layout-column-inner\"><!-- wp:image {\"align\":\"full\",\"id\":87,\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"className\":\"is-style-default\"} -->\n<figure class=\"wp-block-image alignfull size-full is-style-default\"><img src=\"http://ar-auto-repair-services.local/wp-content/uploads/2022/04/2.png\" alt=\"\" class=\"wp-image-87\"/></figure>\n<!-- /wp:image --></div></div>\n<!-- /wp:genesis-blocks/gb-column -->\n\n<!-- wp:genesis-blocks/gb-column -->\n<div class=\"wp-block-genesis-blocks-gb-column gb-block-layout-column\"><div class=\"gb-block-layout-column-inner\"><!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#32373c\"}}} -->\n<p class=\"has-text-color\" style=\"color:#32373c\"><strong>Tire Pressure Light</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>signals an issue with your tire pressure or the Tire Pressure Monitoring System (TPMS)</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:genesis-blocks/gb-column --></div></div>\n<!-- /wp:genesis-blocks/gb-columns -->\n\n<!-- wp:genesis-blocks/gb-columns {\"columns\":2,\"layout\":\"gb-2-col-wideright\",\"align\":\"center\",\"marginBottom\":5,\"marginUnit\":\"%\",\"padding\":6,\"paddingTop\":6,\"paddingRight\":6,\"paddingBottom\":4,\"paddingLeft\":6,\"paddingUnit\":\"%\",\"customBackgroundColor\":\"#efefef\"} -->\n<div class=\"wp-block-genesis-blocks-gb-columns gb-layout-columns-2 gb-2-col-wideright gb-has-custom-background-color aligncenter\" style=\"margin-bottom:5%;padding-top:6%;padding-right:6%;padding-bottom:4%;padding-left:6%;background-color:#efefef\"><div class=\"gb-layout-column-wrap gb-block-layout-column-gap-2 gb-is-responsive-column\"><!-- wp:genesis-blocks/gb-column {\"textAlign\":\"center\"} -->\n<div class=\"wp-block-genesis-blocks-gb-column gb-block-layout-column\"><div class=\"gb-block-layout-column-inner\" style=\"text-align:center\"><!-- wp:image {\"align\":\"center\",\"id\":85,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-full\"><img src=\"http://ar-auto-repair-services.local/wp-content/uploads/2022/04/4.png\" alt=\"\" class=\"wp-image-85\"/></figure></div>\n<!-- /wp:image --></div></div>\n<!-- /wp:genesis-blocks/gb-column -->\n\n<!-- wp:genesis-blocks/gb-column -->\n<div class=\"wp-block-genesis-blocks-gb-column gb-block-layout-column\"><div class=\"gb-block-layout-column-inner\"><!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#32373c\"}}} -->\n<p class=\"has-text-color\" style=\"color:#32373c\"><strong>Battery Alert Light </strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Signifies a problem with the vehicle’s charging system.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:genesis-blocks/gb-column --></div></div>\n<!-- /wp:genesis-blocks/gb-columns -->\n\n<!-- wp:genesis-blocks/gb-columns {\"columns\":2,\"layout\":\"gb-2-col-wideright\",\"align\":\"center\",\"marginBottom\":5,\"marginUnit\":\"%\",\"padding\":6,\"paddingTop\":6,\"paddingRight\":6,\"paddingBottom\":4,\"paddingLeft\":6,\"paddingUnit\":\"%\",\"customBackgroundColor\":\"#efefef\"} -->\n<div class=\"wp-block-genesis-blocks-gb-columns gb-layout-columns-2 gb-2-col-wideright gb-has-custom-background-color aligncenter\" style=\"margin-bottom:5%;padding-top:6%;padding-right:6%;padding-bottom:4%;padding-left:6%;background-color:#efefef\"><div class=\"gb-layout-column-wrap gb-block-layout-column-gap-2 gb-is-responsive-column\"><!-- wp:genesis-blocks/gb-column {\"columnVerticalAlignment\":\"center\"} -->\n<div class=\"wp-block-genesis-blocks-gb-column gb-block-layout-column gb-is-vertically-aligned-center\"><div class=\"gb-block-layout-column-inner\"><!-- wp:image {\"align\":\"center\",\"id\":88,\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"className\":\"is-style-default\"} -->\n<div class=\"wp-block-image is-style-default\"><figure class=\"aligncenter size-full\"><img src=\"http://ar-auto-repair-services.local/wp-content/uploads/2022/04/1.png\" alt=\"\" class=\"wp-image-88\"/></figure></div>\n<!-- /wp:image --></div></div>\n<!-- /wp:genesis-blocks/gb-column -->\n\n<!-- wp:genesis-blocks/gb-column -->\n<div class=\"wp-block-genesis-blocks-gb-column gb-block-layout-column\"><div class=\"gb-block-layout-column-inner\"><!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#32373c\"}}} -->\n<p class=\"has-text-color\" style=\"color:#32373c\"><strong>Oil Pressure Light</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Indicates that there is an issue with your car’s oil pressure system</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:genesis-blocks/gb-column --></div></div>\n<!-- /wp:genesis-blocks/gb-columns -->\n\n<!-- wp:genesis-blocks/gb-columns {\"columns\":2,\"layout\":\"gb-2-col-wideright\",\"align\":\"center\",\"marginBottom\":5,\"marginUnit\":\"%\",\"padding\":6,\"paddingTop\":6,\"paddingRight\":6,\"paddingBottom\":4,\"paddingLeft\":6,\"paddingUnit\":\"%\",\"customBackgroundColor\":\"#efefef\"} -->\n<div class=\"wp-block-genesis-blocks-gb-columns gb-layout-columns-2 gb-2-col-wideright gb-has-custom-background-color aligncenter\" style=\"margin-bottom:5%;padding-top:6%;padding-right:6%;padding-bottom:4%;padding-left:6%;background-color:#efefef\"><div class=\"gb-layout-column-wrap gb-block-layout-column-gap-2 gb-is-responsive-column\"><!-- wp:genesis-blocks/gb-column -->\n<div class=\"wp-block-genesis-blocks-gb-column gb-block-layout-column\"><div class=\"gb-block-layout-column-inner\"><!-- wp:image {\"align\":\"center\",\"id\":86,\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"className\":\"is-style-default\"} -->\n<div class=\"wp-block-image is-style-default\"><figure class=\"aligncenter size-full\"><img src=\"http://ar-auto-repair-services.local/wp-content/uploads/2022/04/3.png\" alt=\"\" class=\"wp-image-86\"/></figure></div>\n<!-- /wp:image --></div></div>\n<!-- /wp:genesis-blocks/gb-column -->\n\n<!-- wp:genesis-blocks/gb-column -->\n<div class=\"wp-block-genesis-blocks-gb-column gb-block-layout-column\"><div class=\"gb-block-layout-column-inner\"><!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#32373c\"}}} -->\n<p class=\"has-text-color\" style=\"color:#32373c\"><strong><strong>Engine Temp Warning Light</strong></strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>It means that your engine is overheating.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:genesis-blocks/gb-column --></div></div>\n<!-- /wp:genesis-blocks/gb-columns -->\n\n<!-- wp:genesis-blocks/gb-columns {\"columns\":2,\"layout\":\"gb-2-col-wideright\",\"marginBottom\":5,\"marginUnit\":\"%\",\"padding\":6,\"paddingTop\":6,\"paddingRight\":6,\"paddingBottom\":4,\"paddingLeft\":6,\"paddingUnit\":\"%\",\"customBackgroundColor\":\"#efefef\"} -->\n<div class=\"wp-block-genesis-blocks-gb-columns gb-layout-columns-2 gb-2-col-wideright gb-has-custom-background-color\" style=\"margin-bottom:5%;padding-top:6%;padding-right:6%;padding-bottom:4%;padding-left:6%;background-color:#efefef\"><div class=\"gb-layout-column-wrap gb-block-layout-column-gap-2 gb-is-responsive-column\"><!-- wp:genesis-blocks/gb-column {\"textAlign\":\"center\"} -->\n<div class=\"wp-block-genesis-blocks-gb-column gb-block-layout-column\"><div class=\"gb-block-layout-column-inner\" style=\"text-align:center\"><!-- wp:image {\"id\":84,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full\"><img src=\"http://ar-auto-repair-services.local/wp-content/uploads/2022/04/5.png\" alt=\"\" class=\"wp-image-84\"/></figure>\n<!-- /wp:image --></div></div>\n<!-- /wp:genesis-blocks/gb-column -->\n\n<!-- wp:genesis-blocks/gb-column -->\n<div class=\"wp-block-genesis-blocks-gb-column gb-block-layout-column\"><div class=\"gb-block-layout-column-inner\"><!-- wp:paragraph {\"style\":{\"color\":{\"text\":\"#32373c\"}}} -->\n<p class=\"has-text-color\" style=\"color:#32373c\"><strong><strong>Check Engine Light</strong></strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>May appear for a variety of reasons. Sometimes it is triggered by an open, loose or cracked gas cap, which causes fuel to evaporate. But sometimes it indicates a serious issue, like low oil pressure or overheating!</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:genesis-blocks/gb-column --></div></div>\n<!-- /wp:genesis-blocks/gb-columns -->\n\n<!-- wp:genesis-blocks/gb-columns {\"columns\":1,\"layout\":\"one-column\",\"align\":\"full\",\"paddingTop\":15,\"paddingRight\":5,\"paddingBottom\":15,\"paddingLeft\":5,\"paddingUnit\":\"%\",\"columnMaxWidth\":1200,\"className\":\"gpb-agency-section-icon-mini-card\"} -->\n<div class=\"wp-block-genesis-blocks-gb-columns gpb-agency-section-icon-mini-card gb-layout-columns-1 one-column gb-columns-center alignfull\" style=\"padding-top:15%;padding-right:5%;padding-bottom:15%;padding-left:5%\"><div class=\"gb-layout-column-wrap gb-block-layout-column-gap-2 gb-is-responsive-column\" style=\"max-width:1200px\"><!-- wp:genesis-blocks/gb-column -->\n<div class=\"wp-block-genesis-blocks-gb-column gb-block-layout-column\"><div class=\"gb-block-layout-column-inner\"><!-- wp:genesis-blocks/gb-container {\"containerMarginBottom\":5,\"containerMaxWidth\":700} -->\n<div style=\"margin-bottom:5%\" class=\"wp-block-genesis-blocks-gb-container gb-block-container\"><div class=\"gb-container-inside\"><div class=\"gb-container-content\" style=\"max-width:700px\"></div></div></div>\n<!-- /wp:genesis-blocks/gb-container --></div></div>\n<!-- /wp:genesis-blocks/gb-column --></div></div>\n<!-- /wp:genesis-blocks/gb-columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','Services','','inherit','closed','closed','','17-revision-v1','','','2022-04-29 09:04:38','2022-04-29 13:04:38','',17,'http://ar-auto-repair-services.local/?p=143',0,'revision','',0);
